import React from "react";
import { useLocation, useNavigate } from "react-router-dom";

// --- Import all 16 specific form components ---
// Ensure these paths are correct relative to FormPage.js
// If your forms are in src/components/forms/, adjust the paths accordingly.

// VF1 Forms
import ACFillingVF1 from "../components////////////////////////ACFillingVF1";
import ClutchProcessVF1 from "../components/forms/ClutchProcessVF1";
import CoolantProcessVF1 from "../components/forms/CoolantProcessVF1";
import PowerSteeringVF1 from "../components/forms/PowerSteeringVF1";
import UreaFillingVF1 from "../components/forms/UreaFillingVF1";

// VF2 Forms
import ACFillingVF2 from "../components/forms/ACFillingVF2";
import ClutchProcessVF2 from "../components/forms/ClutchProcessVF2";
import CoolantProcessVF2 from "../components/forms/CoolantProcessVF2";
import PowerSteeringVF2 from "../components/forms/PowerSteeringVF2";
import UreaFillingVF2 from "../components/forms/UreaFillingVF2";

// VF3 Forms
import ACFillingVF3 from "../components/forms/ACFillingVF3";
import ClutchProcessVF3 from "../components/forms/ClutchProcessVF3";
import CoolantProcessVF3 from "../components/forms/CoolantProcessVF3";
import PowerSteeringVF3 from "../components/forms/PowerSteeringVF3";
import UreaFillingVF3 from "../components/forms/UreaFillingVF3";
import DieselFillingVF3 from "../components/forms/DieselFillingVF3"; // VF3 specific form

// --- Component Mapping ---
// This map links the "area" (VFx) and "machine" names to their respective React components.
// The keys here must exactly match the 'area' and 'machine' values passed from App.js's Dashboard.
const formComponentMap = {
  // VF1
  "VF1-AC FILLING MACHINE": ACFillingVF1,
  "VF1-CLUTCH OIL FILLING MACHINE": ClutchProcessVF1,
  "VF1-COOLANT OIL FILLING MACHINE": CoolantProcessVF1,
  "VF1-POWER STEERING OIL FILLING MACHINE": PowerSteeringVF1,
  "VF1-UREA FILLING MACHINE": UreaFillingVF1,

  // VF2
  "VF2-AC FILLING MACHINE": ACFillingVF2,
  "VF2-CLUTCH OIL FILLING MACHINE": ClutchProcessVF2,
  "VF2-COOLANT OIL FILLING MACHINE": CoolantProcessVF2,
  "VF2-POWER STEERING OIL FILLING MACHINE": PowerSteeringVF2,
  "VF2-UREA FILLING MACHINE": UreaFillingVF2,

  // VF3
  "VF3-AC FILLING MACHINE": ACFillingVF3,
  "VF3-CLUTCH OIL FILLING MACHINE": ClutchProcessVF3,
  "VF3-COOLANT OIL FILLING MACHINE": CoolantProcessVF3,
  "VF3-POWER STEERING OIL FILLING MACHINE": PowerSteeringVF3,
  "VF3-UREA FILLING MACHINE": UreaFillingVF3,
  "VF3-DIESEL OIL FILLING MACHINE": DieselFillingVF3,
};

const FormPage = () => {
  const location = useLocation(); // Hook to access the current location object
  const navigate = useNavigate(); // Hook for programmatic navigation

  // Extract 'area' and 'machine' from the navigation state
  const { area, machine } = location.state || {}; // Default to empty object if state is null/undefined

  // Construct the key to look up the component in the map
  const formKey = `${area}-${machine}`;

  // Get the component from the map
  const SpecificForm = formComponentMap[formKey];

  // Basic styling for the container to center the form
  const containerStyle = {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    minHeight: "100vh", // Take full viewport height
    backgroundColor: "#f0f2f5", // Light background color
    padding: "20px",
  };

  const errorMessageStyle = {
    textAlign: "center",
    color: "#d32f2f",
    backgroundColor: "#ffebee",
    border: "1px solid #ef9a9a",
    borderRadius: "8px",
    padding: "20px",
    margin: "50px auto",
    maxWidth: "500px",
    boxShadow: "0 4px 8px rgba(0,0,0,0.1)",
  };

  if (!area || !machine) {
    // If state is missing, it means direct access or an error in navigation
    return (
      <div style={containerStyle}>
        <div style={errorMessageStyle}>
          <h2>Error: Form Not Found</h2>
          <p>
            It seems you've navigated to this page without selecting a factory
            and machine.
          </p>
          <button
            onClick={() => navigate("/")}
            style={{
              marginTop: "20px",
              padding: "10px 20px",
              backgroundColor: "#007bff",
              color: "white",
              border: "none",
              borderRadius: "5px",
              cursor: "pointer",
            }}
          >
            Go to Dashboard
          </button>
        </div>
      </div>
    );
  }

  if (!SpecificForm) {
    // If a valid area/machine was passed but no component found in the map
    return (
      <div style={containerStyle}>
        <div style={errorMessageStyle}>
          <h2>Error: Form Component Not Found</h2>
          <p>
            No form component found for: <strong>Factory: {area}</strong> and{" "}
            <strong>Machine: {machine}</strong>.
          </p>
          <p>
            Please check the `formComponentMap` in `FormPage.js` and ensure the
            component is imported correctly.
          </p>
          <button
            onClick={() => navigate("/")}
            style={{
              marginTop: "20px",
              padding: "10px 20px",
              backgroundColor: "#007bff",
              color: "white",
              border: "none",
              borderRadius: "5px",
              cursor: "pointer",
            }}
          >
            Go to Dashboard
          </button>
        </div>
      </div>
    );
  }

  // If a valid component is found, render it
  return (
    <div style={containerStyle}>
      <SpecificForm />
    </div>
  );
};

export default FormPage;
